            arr.append('()')
            for i in range(int((n - 2) / 4)):
                arr.append('(')
            for i in range(int((n - 2) / 4)):
                arr.append(')')
        else:
            for i in range(int((n - 4) / 4)):
                arr.append('(')
            for i in range(int((n - 4) / 4)):
                arr.append(')')
            arr.append('(())')
            for i in range(int((n - 4) / 4)):
                arr.append('(')
            for i in range(int((n - 4) / 4)):
                arr.append(')')
    else:
        for i in range(int(n % (k - 2) / 2)):
            arr.append('(')
        for i in range(int(n / (k - 2))):
            for j in range(int((k - 2) / 2)):
